B.Yw=A.a(s([B.bN,B.ea]),t.F)
B.Gh=new A.bn(B.aQ,4,1,B.Yw,4,"This weapon is a simple muzzle-loaded weapon, consisting of a smooth-bore metal tube fixed to a base plate to spread out the recoil. It launches explosive shells (called bombs) in a high-arcing ballistic trajectory.",24,"mortar")
