B.tP=A.a(s([B.bN,B.cK]),t.F)
B.mM=new A.bn(B.bu,4,0,B.tP,3,"It's a remote-controlled car with a bomb attached to it! To attack, drop an RC Car, facing any direction, within Short range of the attacker (Collision Window).\n\nThe RC Car is a lightweight vehicle in current Gear 3, with 1 Hull Point, 1 Crew, and 0 Handling. Though not officially part of the team, it is controlled as a separate vehicle by the attacker. It can make shooting attacks with a mounted Handgun, but it cannot change Gear.\n\nIf an RC Car is involved in a Collision or Wipeout, it immediately suffers one point of damage before resolving other effects. When it would be Wrecked, it instead explodes with a 4D6 Large Burst attack.\n\nOPTIONAL: Instead of operating as an independent vehicle, the RC Car must be moved and fired by a dedicated Crew member during the Attack Step. If no Crew member is assigned (or available), the RC Car simply moves using the Medium Straight template.",27,"rcCarBombs")
B.ue=A.a(s([B.bN]),t.F)
B.Gz=new A.bn(B.aQ,6,2,B.ue,5,"This weapon fires self-propelled, unguided, explosive shells, powered by small rocket engines.",28,"rockets")
B.GA=new A.bn(B.bu,2,0,B.tP,3,"To attack, drop a Sentry Gun within Short range of the attacker. The gun is considered a lightweight, Destructible obstacle that may be targeted and has 2 Hull Points. Any enemy vehicle ending its Movement Step within Medium range (360-degree Arc) of the gun is immediately and automatically targeted with a 2D6 shooting attack.",29,"sentryGun")
B.a4C=new A.lQ(3,"long")
B.mJ=new A.bn(B.a4C,0,0,B.kE,4,"This weapon is more effective at shorter ranges. Its Attack Dice are 3D6 at Short range, 2D6 at Medium range, and 1D6 at Long range.",30,"shotgun")
B.Gu=new A.bn(B.bu,0,0,B.tY,1,"This weapon's template is treated as an obstruction for the purposes of determining Cover, and any vehicle in contact with it during the Attack Step is considered Distracted. If any part of a vehicle's movement template or Final Position contacts the template during the Movement Step, the vehicle gains 1 Hazard Token at the end of the step.",31,"smokeDropper")
