B.GF=new A.bn(B.d6,3,0,B.kE,5,"A Submachine Gun (SMG) is a magazine-fed, automatic carbine designed to fire handgun cartridges, though it has noticeably less firepower than a Machine Gun.",33,"submachineGun")
B.iP=new A.eI("Does not need to declare a Facing.",12,"noFacing")
B.Zy=A.a(s([B.de,B.iQ,B.ea,B.iP]),t.F)
B.Gj=new A.bn(B.d6,0,2,B.Zy,4,"This weapon is a powerful sonic device that emits a shockwave capable of hurling nearby vehicles into the air. During an attack, all vehicles (friend or foe) within Medium range (360-degree Arc) of the attacker immediately make a Flip check. For this check, the targets' current Gear is considered 2 higher than their actual current Gear, to a maximum of 6.",34,"thumper")
B.tX=A.a(s([B.iP]),t.F)
B.mK=new A.bn(B.d6,0,3,B.tX,4,'This weapon does not require a target or cause direct damage. When "fired," a rocking sonic blast automatically causes one hit to every vehicle (friend or foe) within Medium range (360-degree Arc). These hits may be Evaded, but uncanceled hits can either add 1 Hazard Token to the target or remove 1 Hazard Token from the target (attacker\'s choice).',35,"wallOfAmplifiers")
B.Dd=new A.lQ(7,"doubleOrDropped")
B.Gx=new A.bn(B.Dd,0,4,B.ue,4,"This weapon is a gun that shoots wrecked vehicles instead of bullets.\n\nWhen Front- or Side-mounted, the weapon fires like a trebuchet. The attacker places a penny-sized marker within Double range of the Lobber's fire Arc and rolls a Skid Die. For a Shift result, place a Wreck in any orientation, touching the marker (Collision Window). For a Spin or Slide result, the player to the left of of the attacker places a Wreck anywhere within Short range of the marker (Collision Window). For a Hazard result, the player to the left of the attacker places a Wreck touching the attacker's vehicle (Collision Window).\n\nRear-mounted Lobbers act as dumpers, dropping a Wreck behind the attacking vehicle, in contact with its rear (no Collision Window).\n\nIf a vehicle sporting a Lobber collides with a Wreck, it may gain 1 Ammo Token for the weapon.",36,"wreckLobber")
B.Go=new A.bn(B.li,0,3,B.tX,2,"This weapon does not require a target. When swung, the Ball creates a T-Bone Collision between the attacker and all vehicles and destructible obstacles within Short range (360-degree Arc). While resolving the Collisions, all affected vehicles are considered to have no weapons or perks, and each must declare an Evade reaction. The attacker gets +2 Smash Attack dice and suffers no Hazards. Attacker upgrades such as Rams are not brought to bear during these Collisions.",37,"wreckingBall")
